import React, { Component } from 'react';
import {
  EuiButton,
  EuiCard,
  EuiFlexGroup,
  EuiFlexItem,
  EuiIcon,
} from '@elastic/eui';
import Slider from 'react-slick';
import '../styles/ProfileCard.css';

const cardFooterContent = (
  <EuiFlexGroup justifyContent="flexEnd">
    <EuiFlexItem grow={false}>
      <EuiButton>Go for it</EuiButton>
    </EuiFlexItem>
  </EuiFlexGroup>
);

class ProfileCard extends Component {
  render() {
      var settings = {
        dots: true,
        infinite: true,
        speed: 100,
        slidesToShow: 4,
        slidesToScroll: 1,
        variableWidth: true,
        waitForAnimate: false,
        beforeChange: function(current, next) {
          console.log(current);
        },
        afterChange: function(current) {
          console.log(current);
        }
      };
      return (
        <div className="container">
          <Slider {...settings} className="variable-width2">
        <div className="Card-item">
          <EuiCard
            textAlign="left"
            image="https://source.unsplash.com/400x200/?Nature"
            title="Elastic in Nature"
            description="Example of a card's description. Stick to one or two sentences."
            footer={cardFooterContent}
          />
        </div>
        <div className="Card-item">
          <EuiCard
            textAlign="left"
            image="https://source.unsplash.com/400x200/?Water"
            title="Elastic in Water"
            description="Example of a card's description. Stick to one or two sentences."
            footer={cardFooterContent}
          />
        </div>
        <div className="Card-item">
          <EuiCard
            textAlign="left"
            href="https://elastic.github.io/eui/"
            image="https://source.unsplash.com/400x200/?City"
            icon={<EuiIcon size="xxl" type="logoBeats" />}
            title={'Beats in the City'}
            description="This card has an href and should be a link."
          />
        </div>
      </Slider>
      </div>
      )
  }
}

export default ProfileCard;
